import React from 'react';
import Sdata from './Sdata'
import Card from './Card';

const Amazon=()=>{
    return(
        <Card key={Sdata[3].id} 
imgsrc={Sdata[3].imgsrc} 
text={Sdata[3].text}
 title={Sdata[3].title}
  link={Sdata[3].link}/>
    );
}
export default Amazon;
